INSERT INTO `evento` (`id`, `foto`, `nome`, `ricezione`, `costo`, `campo`, `descrizione`, `partecipanti`, `id_indirizzo`, `id_sport`) VALUES
(20, NULL, 'Partita Amatoriale', '2025-06-01 18:00:00', 10, 'Campo A1', 'Unisciti a noi per una sfida amichevole di calcio! Unoccasione perfetta per divertirsi, allenarsi e conoscere nuove persone appassionate di sport.', 10, 1, 1),
(21, NULL, 'Torneo di Tennis', '2025-06-02 16:00:00', 15, 'Campo T1', 'Sfida i tuoi limiti nel nostro torneo di tennis aperto a tutti! Premi per i vincitori, gadget e tanto divertimento in unatmosfera sportiva e coinvolgente.', 8, 1, 2),
(22, NULL, 'Allenamento Basket', '2025-06-03 19:00:00', 5, 'Campo B1', 'Una sessione dinamica di basket con esercizi tecnici e partita finale. Ideale per chi vuole migliorare le proprie abilit e divertirsi in compagnia.', 12, 1, 3),
(23, NULL, 'Nuoto Libero', '2025-06-04 08:00:00', 6.5, 'Piscina N1', 'Goditi unora di nuoto libero in una piscina moderna e accogliente. Ricarica corpo e mente con il miglior alleato del benessere!', 20, 1, 4),
(24, NULL, 'Corsa al Parco', '2025-06-05 07:00:00', 0, 'Pista P1', 'Inizia la giornata con energia! Allenamento gratuito di gruppo per corridori di tutti i livelli. Porta la tua voglia di muoverti e il resto lo mettiamo noi.', 15, 1, 5),
(25, NULL, 'Partita Serale', '2025-06-06 20:30:00', 12, 'Campo A2', 'La magia del calcio sotto le luci serali! Partita amatoriale 7vs7 con atmosfera da vero stadio e tanto spirito sportivo.', 14, 1, 1),
(26, NULL, 'Doppio Misto', '2025-06-07 17:00:00', 10, 'Campo T2', 'Evento di tennis in doppio misto per chi ama divertirsi e competere in coppia. Livello amatoriale, tanta passione e una community accogliente.', 8, 1, 2),
(27, NULL, 'Basket 3x3', '2025-06-08 18:00:00', 7, 'Campo B2', 'Torneo veloce e spettacolare di basket 3x3. Sfide intense, ritmo serrato e premiazioni finali. Perfetto per chi ama ladrenalina!', 6, 1, 3),
(28, NULL, 'Gara di Stile Libero', '2025-06-09 10:00:00', 8, 'Piscina N2', 'Partecipa alla nostra gara di stile libero! Competizione aperta a tutti con tempi ufficiali e premi simbolici. Nuota e supera te stesso!', 12, 1, 4),
(29, NULL, '10km Challenge', '2025-06-10 09:00:00', 3, 'Pista P2', 'La corsa che stavi aspettando! Un percorso da 10km per testare la tua resistenza in compagnia di altri runner motivati. Acqua e ristori inclusi.', 30, 1, 5),
(30, NULL, 'Calcio Senior', '2025-06-11 18:00:00', 10, 'Campo A3', 'Partita riservata agli over 35. Spirito sportivo, zero agonismo e tanto divertimento per chi non ha mai smesso di amare il calcio.', 11, 1, 1),
(31, NULL, 'Tennis Junior', '2025-06-12 15:00:00', 5, 'Campo T3', 'Allenamento di tennis dedicato ai pi giovani. Tecnica, gioco e divertimento seguiti da istruttori qualificati.', 10, 1, 2),
(32, NULL, 'Allenamento Basket U18', '2025-06-13 17:00:00', 4, 'Campo B3', 'Sessione dedicata ai ragazzi under 18 con focus su tecnica, coordinazione e gioco di squadra. Per crescere insieme nello sport.', 12, 1, 3),
(33, NULL, 'Acquagym', '2025-06-14 09:00:00', 6, 'Piscina N3', 'Ritmo, musica e benessere! Lezione di acquagym per tonificare il corpo e liberare la mente. Adatta a ogni et.', 16, 1, 4),
(34, NULL, 'Running Training', '2025-06-15 08:00:00', 0, 'Pista P3', 'Allenamento collettivo per runner principianti e intermedi. Scopri nuove tecniche e condividi la passione per la corsa!', 20, 1, 5),
(35, NULL, 'Finale Calcio', '2025-06-16 19:00:00', 13, 'Campo A4', 'La grande finale del torneo amatoriale! Vieni a tifare o a giocare in una serata di emozioni forti e spirito sportivo.', 22, 1, 1),
(36, NULL, 'Open Tennis', '2025-06-17 16:30:00', 12, 'Campo T4', 'Sfida i migliori tennisti della zona in un torneo open ricco di sorprese! Premi per i vincitori e divertimento per tutti.', 16, 1, 2),
(37, NULL, 'Street Basket', '2025-06-18 18:00:00', 5, 'Campo B4', 'Un torneo di basket 3v3 in stile street, tra musica, energia e puro spettacolo. Vieni a giocare o a tifare!', 9, 1, 3),
(38, NULL, 'Nuoto Agonistico', '2025-06-19 11:00:00', 10, 'Piscina N4', 'Competizione ufficiale per nuotatori esperti. Iscrizione obbligatoria, medaglie per i primi tre classificati.', 20, 1, 4),
(39, NULL, 'Trail Running', '2025-06-20 07:00:00', 4, 'Pista P4', 'Percorso immerso nella natura per amanti del trail. Salite, discese e panorami mozzafiato in unesperienza unica.', 25, 1, 5),
(40, NULL, 'Calcio Giovani', '2025-06-21 17:00:00', 8, 'Campo A5', 'Match dedicato a giovani calciatori under 18. Talento, gioco pulito e tanto entusiasmo in campo.', 18, 1, 1),
(41, NULL, 'Tennis Sunset', '2025-06-22 19:30:00', 7, 'Campo T5', 'Gioca a tennis al tramonto in unatmosfera rilassata e suggestiva. Perfetto per concludere la giornata in bellezza.', 4, 1, 2),
(42, NULL, 'Basket Femminile', '2025-06-23 18:00:00', 6, 'Campo B5', 'Evento tutto al femminile! Torneo amatoriale tra squadre composte da ragazze grintose e appassionate.', 10, 1, 3),
(43, NULL, 'Lezione Nuoto Baby', '2025-06-24 10:30:00', 5, 'Piscina N5', 'Lezione di nuoto pensata per bambini dai 4 ai 7 anni. In acqua con istruttori esperti, in totale sicurezza e divertimento.', 8, 1, 4),
(44, NULL, 'Maratona Cittadina', '2025-06-25 06:30:00', 0, 'Pista P5', 'Partecipa alla maratona gratuita della tua citt! Un grande evento sportivo per correre insieme tra musica, stand e solidariet.', 100, 1, 5),
(45, NULL, 'Partita Elite', '2025-06-26 20:00:00', 15, 'Campo A6', 'Sfida tra i migliori del circuito amatoriale! Una serata spettacolare con ospiti, foto e tanto tifo.', 22, 1, 1),
(46, NULL, 'Tennis Pro-Am', '2025-06-27 15:00:00', 20, 'Campo T6', 'Giocatori professionisti e amatori insieme in campo per un evento di tennis esclusivo. Posti limitati.', 12, 1, 2),
(47, NULL, 'All Star Game Basket', '2025-06-28 18:00:00', 10, 'Campo B6', 'Una vera e propria festa del basket! Sfide spettacolari, schiacciate e tanto divertimento.', 10, 1, 3);

